<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Set数据结构-遍历</title>
</head>

<body>

    <script>
        const s = new Set([1, 2, 3, 4, 5, 6, 7, 8, 9]);
        s.forEach((value) => {
            console.log(value);
        })
    </script>
</body>

</html>
